        - node:
            text: >-
              NYHET! Hudterapeutens val!


              Med vår nya tjänst Hudterapeutens val gör vi det lättare för dig
              som vill boka en behandling men är lite osäker på vilken som
              skulle passa dig bäst.


              Efter en konsultation bestämmer vi tillsammans behandling utifrån
              din hudtyp, hudtillstånd och ekonomi.


              Detta alternativ är även perfekt för dig som kommer till oss
              regelbundet på ansiktsbehandlingar och vill slippa välja utan
              låter din terapeut bestämma det som passar bäst för dig utifrån
              dina förutsättningar och mål.


              Tjänsten går nu att boka via vår onlinebokning.


              Fr.o.m den 1/6 jobbar Lie mån-fre 11:00-15:00 och Karin tis-tors
              17:15-19:00 (tider kan variera). Välkoma till oss på Pipers
              Hudvård, Pipersgatan 30, Kungsholmen Stockholm.
