      edges:
        - node:
            text: >-
              Tyvärr har yrket Hudterapeut ingen skyddad yrkestitel vilket gör
              att vem som helst kan öppna en skönhetssalong och erbjuda
              skönhet-, och hudvårdsbehandlingar. Detta innebär att personer som
              inte har någon utbildning inom detta yrke kan behandla kunder med
              risk för utebliven effekt, felbehandling och i värsta fall skador.


              Detta ska du ALLTID kolla upp/fråga om innan du gör en behandling:
              (oavsett hur populär en salong/klinik är) •Fråga om den som ska
              behandla dig är en utbildad hudterapeut! Titta efter intyg,
              ID-bricka och auktorisation.

              •Du som konsument ska få ordentlig information om behandlingen och
              eventuella risker.

              •Behandlaren ska göra en bakgrundskoll, det vill säga fråga om
              tidigare erfarenheter av behandlingar och eventuella sjukdomar.

              •Salongen ska ha behandlings-/patientskadeförsäkringar och
              kundolycksfallsförsäkring.


              När du ska göra skönhet-, hudvårdsbehandling, välj en person med
              rätt kompetens – en auktoriserad Hudterapeut som är medlem i SHR.

              ❤️
